import React from 'react';
import { useNavigate } from 'react-router-dom';
import Sidebar from './Sidebar';
// import './App.css';
import './assets.css';

const Assets = () => {
const navigate = useNavigate(); 


  const handleLogout = (e) => {
    e.preventDefault();

    console.log('Logging out');
    navigate('/login');
  };

  return (

    <div className='assets_wrapper'>
    <Sidebar/>


          <button className="topnav-right" onClick={handleLogout}>Out</button>
              <h2 className='assets-h2'>Overview</h2>


                <div className='body'>
                  <h1>Welcome to the Assets Page</h1>
                  <p>Here is your main content.</p>
                </div>
     </div>


  );
};


export default Assets;
